CREATE TABLE IF NOT EXISTS `npc` (
  `npc_id` int(10) NOT NULL,
  `npc_template_id` int(10) NOT NULL,
  `point_x` int(10) NOT NULL,
  `point_y` int(10) NOT NULL,
  `point_z` int(10) NOT NULL,
  `point_angle` double NOT NULL,
  KEY `npc_id` (`npc_id`),
  KEY `npc_template_id` (`npc_template_id`),
  KEY `point` (`point_x`,`point_y`,`point_z`,`point_angle`),
  KEY `xy` (`point_x`,`point_y`),
  KEY `xyz` (`point_x`,`point_y`,`point_z`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

